import React, { useEffect } from 'react';
import './App.css';
import { BrowserRouter, Routes, Route } from 'react-router-dom';
import Navbar from './components/navbar/Navbar';
import Home from './components/home/Home';
import Chefs from './components/chefs/Chefs';
import Restaurants from './components/reastaurants/Restaurants';
import RestaurantPage from './components/reastaurants/components/restaurantsPage/RestaurantPage';
import { idText } from 'typescript';
import SignInPage from './components/signIn/SignInPage';
import SignUpPage from "./components/signUp/SignUpPage";
import {useDispatch, useSelector} from 'react-redux';
import { fetchChefs } from './store/slices/chefsSlice';
import { Istore } from './types/interfaces/Istore';


function App() {
  const dispatch = useDispatch();
  const data = useSelector((state:Istore) => state.chefs.value);
  useEffect(()=>{
    dispatch(fetchChefs)
    console.log(data);
  })

  return (
    <BrowserRouter>
      <Routes>
        <Route path='/' element={<Home/>}/>
        <Route path='/chefs' element={<Chefs/>}/>
        <Route path='/restaurants' element={<Restaurants/>}/>
        <Route path='/restaurants/:id' element={<RestaurantPage/>}/>
        <Route path='/sign-in' element={<SignInPage/>}/>
        <Route path='/sign-up' element={<SignUpPage/>}/>
      </Routes>
    </BrowserRouter>
  );
}

export default App;
